select 
-- Header
status      as Estatus
, firewall  as Plataforma
-- Llaves primarias
, case 
 when rule = 'NA' then ''
 else rule 
end as Moses_ID
, oid       as Despegar_ID 
, ap        as Client_ID 
-- Detalle producto
, portfolio as Portafolio
, ejecutivo as Ejecutivo
, propiedad as Tipo_Propiedad
, cadena    as Cadena
, provider  as Gateway
, hotel     as Hotel
-- Detalle cliente
, modelo    as Modelo
, sitio     as PoS
, canal     as Canal
, agencia   as Cliente
-- Detalle impacto
, case
    when monthly_impact = 'NA' then 0
    else cast(monthly_impact as double)
  end as Monthly_Cost 
--, strategy as Estrategia
--, release_status as Apertura_Estatus
--, release_date   as Apertura_Fecha
from
raw.b2b_block_compiler
where 1=1 
--and sitio in ('US')
--and agencia like '%Ctrip%'
and ap in ('AP12272')
and status = 'blacklist'
--order by cast(monthly_impact as double) desc
order by cadena desc

